INSERT INTO `tbl_articulo` VALUES (1,5,1,28,1,'Monitor gamer Mi 2K Gaming Monitor 27\" + REGALO Teclado y mouse','Xiaomi Mi 2K Gaming Monitor 27\"\nAmplia gama de colores y alta frecuencia de actualización para una experiencia de juego ultra clara\nCalidad de imagen ultra clara, alta frecuencia de actualización, respuesta rápida, mejora de la pantalla... ¡Lo tienes todo!\nLa combinación de la resolución de 2560 × 1440 y la pantalla grande de 27 \"hace que cada movimiento de tu oponente sea más claro.\nLas imágenes ultra claras y refinadas lo mantienen listo para los ataques enemigos en cualquier momento.\nLa pantalla dura IPS tiene un ángulo de visión ultra amplio de 178°, con una vista vívida y realista en todos los ángulos.\nLa pantalla inmersiva viene con un ingenioso diseño de bisel delgado en tres lados, eliminando los bordes y permitiendo el uso combinado sin problemas de varias pantallas para una experiencia inmersiva.\nLa frecuencia de actualización ultra alta de 165 Hz evita las vibraciones y te permite apuntar a tus enemigos con mayor precisión.\nAdaptive-Sync sincroniza la velocidad de transferencia entre la tarjeta gráfica y el monitor, elimina el desgarro y el retraso de la pantalla y proporciona una experiencia de juego fluida y estable.\nLas imágenes y videos en la pantalla son reales con colores vivos y precisos.\nEl modo de luz azul baja puede filtrar la luz azul de onda corta que es perjudicial para los ojos, lo que reduce la fatiga visual y le permite trabajar cómodamente.',NULL,1099.00,'https://mercury.vtexassets.com/arquivos/ids/13238587-1200-1200?v=638253860602400000&width=1200&height=1200&aspect=true',50,'1174365'),(2,14,1,28,1,'MONITOR GAMER TEROS TE-3199N, 27\" IPS, 75HZ, 1920X1080, FULL HD, HDMI, VGA','<table width=\"100%\" style=\"border-spacing: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: ini